import React from 'react';

const Footer = () => {
    return (
        <footer style={{
            textAlign: 'center',
            padding: '16px',
            backgroundColor: '#ed0606',
            marginTop: '40px'
        }}>
            <p>&copy; 2025 Te Whare Runanga. All rights reserved.</p>
        </footer>
    );
};

export default Footer;
